// Inicializar Multiselect
//==========================================================>

	// Para masculino agregar la clase .mas
	//==========================================================>
		$(document).ready(function(){
			$('select.normal').multiselect({
				enableClickableOptGroups: true, //En caso de existir grupos, permite seleccionar el grupo completo
				enableCollapsibleOptGroups: true, //En caso de existir grupos, permite colapsarlos
				disableIfEmpty: true, //Inhabilita en caso de no tener opciones
				disabledText: 'Seleccionar', //Texto en caso de que no existan opciones
				maxHeight: 200, //Define el mximo de alto a desplegar
				buttonClass: 'selectBtn', //Selecciona la clase que se aplicar al botn
				numberDisplayed: 1, //Lmite que se establece para ocupar el texto nSelectedText
				delimiterText: ';', //Separador de alternativas en el botn cuando numberDisplayed > 1
				selectedClass: 'selectedOption', //Clase de opciones seleccionadas
				includeSelectAllOption: true, //Agrega opcin de seleccionar todas
				allSelectedText: 'Todos los valores', //Texto que se muestra cuando todas las opciones estn seleccionadas
				nSelectedText: 'Seleccionados', //Texto cuando el lmite de seleccin (numberDisplayed) es alcanzado
				selectAllText: 'Todos los valores', //Texto de includeSelectAllOption
			});
		});

	// Con buscador agregar la clase .search
	//==========================================================>
		$(document).ready(function(){
			$('select.search').multiselect({
				enableClickableOptGroups: true, //En caso de existir grupos, permite seleccionar el grupo completo
				enableCollapsibleOptGroups: true, //En caso de existir grupos, permite colapsarlos
				disableIfEmpty: true, //Inhabilita en caso de no tener opciones
				disabledText: 'Seleccionar', //Texto en caso de que no existan opciones
				maxHeight: 200, //Define el mximo de alto a desplegar
				buttonClass: 'selectBtn', //Selecciona la clase que se aplicar al botn
				numberDisplayed: 1, //Lmite que se establece para ocupar el texto nSelectedText
				delimiterText: ';', //Separador de alternativas en el botn cuando numberDisplayed > 1
				selectedClass: 'selectedOption', //Clase de opciones seleccionadas
				includeSelectAllOption: true, //Agrega opcin de seleccionar todas
				allSelectedText: 'Todos los valores', //Texto que se muestra cuando todas las opciones estn seleccionadas
				nSelectedText: 'Seleccionados', //Texto cuando el lmite de seleccin (numberDisplayed) es alcanzado
				selectAllText: 'Todos los valores', //Texto de includeSelectAllOption
				enableFiltering: true, //Habilita el filtro en la cabecera
				enableCaseInsensitiveFiltering: true, //Inhabilita el case sensitive
				filterPlaceholder: 'Buscar...', //Placeholder del buscador
			});
		});

// Inicializar Datepicker
//==========================================================>

	// Normal
	//==========================================================>
		$(function () {
			$('.datepicker').datetimepicker({
				stepping: 5,
				icons: {
					close: 'glyphicon glyphicon-ok',
					clear: 'glyphicon glyphicon-remove'
					},
				format: 'DD/MM/YYYY',
				useCurrent: true,
				viewMode: 'days',
				showTodayButton: true,
				showClear: true,
				showClose: true,
				ignoreReadonly: true,
			});
		});

	// Con semana
	//==========================================================>
		$(function () {
			$('.datepickerW').datetimepicker({
				stepping: 5,
				icons: {
					close: 'glyphicon glyphicon-ok',
					clear: 'glyphicon glyphicon-remove'
					},
				format: 'DD/MM/YYYY',
				useCurrent: true,
				calendarWeeks: true,
				viewMode: 'days',
				showTodayButton: true,
				showClear: true,
				showClose: true,
				ignoreReadonly: true,
			});
		});

	// Con semana y hora
	//==========================================================>
		$(function () {
			$('.datepickerWH').datetimepicker({
				stepping: 5,
				icons: {
					close: 'glyphicon glyphicon-ok',
					clear: 'glyphicon glyphicon-remove'
					},
				format: 'DD/MM/YYYY HH:mm',
				useCurrent: true,
				calendarWeeks: true,
				viewMode: 'days',
				showTodayButton: true,
				showClear: true,
				showClose: true,
				ignoreReadonly: true,
			});
		});

	// Slo Hora
	//==========================================================>
		$(function () { //Propiedades del DatePicker
			$('.datepickerH').datetimepicker({
				stepping: 5,
				icons: {
					close: 'glyphicon glyphicon-ok',
					clear: 'glyphicon glyphicon-remove'
					},
				format: 'HH:mm',
				useCurrent: true,
				showTodayButton: true,
				showClear: true,
				showClose: true,
				ignoreReadonly: true,
			});
		});
	//Con este cdigo no permite que dos datepickers sean incoherentes
	//==========================================================>
	$(document).ready(function(){
			$("#datePicker1").on("dp.change", function (e) {
			$('#datePicker2').data("DateTimePicker").minDate(e.date);
		});
		$("#datePicker2").on("dp.change", function (e) {
			$('#datePicker1').data("DateTimePicker").maxDate(e.date);
		});
		});
		// No funciona si se usa useCurrent: true, ni tampoco daysOfWeekDisabled

//Comportamiento de men header
//==========================================================>
	$('.dropmenu').on('click',function(){
		$(this).find('ul').slideDown();
	})
	$('.dropmenu').on('mouseleave',function(){
		$(this).find('ul').slideUp();
	})
	$(document).on('click',function(e){
		var target = e.target
		// console.log(target);
		// console.log($(target));
		// console.log($(target).parents());
		condition1 = $(target).is('.dropmenu')
		condition2 = $(target).parents().is('.dropmenu')
		if (!(condition1 || condition2))
			{
				$('.dropmenu ul').slideUp();
			}
	})

	//Tooltip-Modal-Popover Activate
//==========================================================>
$(document).ready(function()
{
	$('[data-toggle="tooltip"]').tooltip();
	$('#main-modal').modal();
	$('[data-toggle="popover"]').popover();
});
$('body').on('click', function (e) {
$('[data-toggle="popover"]').each(function () {
	//the 'is' for buttons that trigger popups
	//the 'has' for icons within a button that triggers a popup
	if (!$(this).is(e.target) && $(this).has(e.target).length === 0 && $('.popover').has(e.target).length === 0) {
		$(this).popover('hide');
	}
});
});

