//Agrega el data-footer como descripcin de la imagen en el efecto Hover
$(document).ready(function(){
$('.galleryLightbox .imageContainer a').each(function(){
	$content = $(this).attr('data-footer')
	if($content != null){
		$(this).find('.imgFluid').addClass('content').attr('data-content',$content)
	}
})
})

// Hack to enable multiple modals by making sure the .modal-open class
// is set to the <body> when there is at least one modal open left
$('body').on('hidden.bs.modal', function () {
    if($('.modal.in').length > 0)
    {
        $('body').addClass('modal-open');
    }
});